import React from "react";
import "./Settings.css";
import { useNavigate } from 'react-router-dom';

const options = [
  { name: "Theme & Appearance", icon: "üé®", path: "settings/app_support/theme_appearance" },
  { name: "Language", icon: "üåç", path: "settings/app_support/language" },
  { name: "Help Center", icon: "‚ùì", path: "settings/app_support/help_center" },
  { name: "Report a Problem", icon: "‚ö†Ô∏è", path: "settings/app_support/report_problem" },
  { name: "Log Out", icon: "üö™", path: "settings/app_support/logout" }
];


const SettingsNotifications = () => {

  const navigate = useNavigate();
  const handleBackButton = () => {
    console.log("Show all clicked");
    navigate('/');
    //navigate('/userProfile');
  };

  return (
    <div className="settings-page">
      <div className="settings-container">
        <div className="settings-header">
          <div className="header-text">
              <button className="btn btn-light btn-lg fs-3 p-10" aria-label="Go back" onClick={handleBackButton}>‚Üê</button>
              <span>Notification</span>
            </div>
        </div>

        <div className="option-container">
          {options.map((option, index) => (
            <button className="option-button"onClick={() => window.location.href = `#/${option.path}`}>
                <div key={index} className="option-card">
                  <img src = {option.icon} alt = {option.icon} />
                  <p>{option.name}</p>
                </div>
              </button>
          ))}
        </div>
      </div>
    </div>
  );
};

export default SettingsNotifications;
